import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import '../assets/styles/all.css';
import '../assets/styles/main.css';

const Main = (props) => {
    return(
        <>
            <div>
                <div className="container">
                    <article className="start">
                        <h1 className="main-title mt-5 text-center">나와 어울리는 학과 TEST (수도권 전문대 ver.)</h1>
                        <h2 className="sub-title mt-5 text-center">2022년 대학 새내기가 되는 나! 나와 어울리는 학과가 있는 수도권 전문대학교는 어딜까?</h2>
                        <img class="updown-slash mt-5" src="img/up-slash.png" alt="up-slash"/>
                        <div class="start-cover mt-3 mb-3">
                            <button type="button" class="btn-start btn btn-primary" onclick='start();'>세렝게티 동물로 알아보기</button>
                        </div>
                    </article>
                </div>
            </div>
        </>
    )
}

export default Main;
